     &amp;#9474;  Here comes the long awaited, challenging and aesthetically stimulating    &amp;#9474;
     &amp;#9474;  debut album from Swedish ambient duo Carbon Based Lifeforms.              &amp;#9474;
     &amp;#9474;  This space fantasy is a beautiful example of the crystalline textures     &amp;#9474;
     &amp;#9474;  and deeply moving melodies which a sound journey is capable of attaining  &amp;#9474;
     &amp;#9474;  in the hands of talented composers                                        &amp;#9474;
     &amp;#9474;  such as Johannes Hedberg and Daniel Ringstr&amp;divide;m.                            &amp;#9474;
     &amp;#9474;  Lilting synth compositions accentuate the acidic tribal ambient grooves   &amp;#9474;
     &amp;#9474;  to hypnotic/trancey effects,                                              &amp;#9474;
     &amp;#9474;  evolving into soft and more meditative moments without sliding into       &amp;#9474;
     &amp;#9474;  isolationism;                                                             &amp;#9474;
     &amp;#9474;  all the tracks are crafted as aural explorations into altered and         &amp;#9474;
     &amp;#9474;  elevated state of consciousness and are excellent for drifting off into   &amp;#9474;
     &amp;#9474;  timeless reflections,                                                     &amp;#9474;
     &amp;#9474;  orchestral and multilayered sounds for journeys into the vastness of      &amp;#9474;
     &amp;#9474;  inner landscapes.                                                         &amp;#9474;
     &amp;#9474;                                                                            &amp;#9474;
     &amp;#9474;  Don't miss this out : Carbon Based Lifeforms are capable of providing     &amp;#9474;
     &amp;#9474;  alluring musical forms!!                                                  &amp;#9474;
