     &amp;#9474;                                                                            &amp;#9474;
     &amp;#9474;  Carbon Based Lifeforms are Johannes Hedberg &amp; Daniel Ringstrom, both      &amp;#9474;
     &amp;#9474;  born in -76 and lives in Gothenburg Sweden.                               &amp;#9474;
     &amp;#9474;  They met in 91 and started playing around with Trackers on the Amiga in   &amp;#9474;
     &amp;#9474;  -92. In 94 they switched to PC's and teamed up with Mikael Lindquist and  &amp;#9474;
     &amp;#9474;  formed a tracker group called Bassment Studios.                           &amp;#9474;
     &amp;#9474;                                                                            &amp;#9474;
     &amp;#9474;  They released their tracks through various BBS's, the bbs Musical         &amp;#9474;
     &amp;#9474;  Storehouse being their WHQ (world head quarter)                           &amp;#9474;
     &amp;#9474;                                                                            &amp;#9474;
     &amp;#9474;  In 95, following Mikaels lead, they left the tracking scene and switched  &amp;#9474;
     &amp;#9474;  to midi. This led to the forming of Notch, mainly focusing on acid,       &amp;#9474;
     &amp;#9474;  techno and house music. CBL was formed in -96 as a side project to        &amp;#9474;
     &amp;#9474;  Notch. CBL later became the main focus of Johannes and Daniel while       &amp;#9474;
     &amp;#9474;  Mikael left and did various solo acts.                                    &amp;#9474;
     &amp;#9474;                                                                            &amp;#9474;
     &amp;#9474;  CBL published their songs on mp3.com in -98, and was featured on the      &amp;#9474;
     &amp;#9474;  promo cd &quot;103 best songs you never heard on mp3.com&quot; wich led to some     &amp;#9474;
     &amp;#9474;  pretty nice downloads and album sales :)                                  &amp;#9474;
     &amp;#9474;                                                                            &amp;#9474;
     &amp;#9474;  In -99 they teamed up with Magnus Birgersson(Solar Fields) to write the   &amp;#9474;
     &amp;#9474;  music for the swedish dancer Olof Persson's performance &quot;Fusion&quot;          &amp;#9474;
